     "html": "<p></p><h4 style=\"text-align:Right\">\nUCSD Project 802055</h4><p></p>\n\n<p></p><h4 style=\"text-align:Right\">\nAdult Consent</h4><p></p>\n\n\n\n<p><br /></p><h3 style=\"text-align:center\"> <b>The Pennsylvania State University, University Park</b></h3><p></p>\n\n<p></p><h3 style=\"text-align:center\"> <b>Consent to Act as a Research Subject and Parent Consent for a Child to Act as a Research Subject</b></h3> <p></p>\n\n<p></p><h4 style=\"text-align:center\"><b>\nThe HEALthy Brain and Child Development (HBCD) Pilot Study</b></h4><p></p>\n\n<p><br /></p><h4 style=\"text-align:left\"><b><i>Introduction</i></b></h4><p></p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Dr. Koraly Pérez-Edgar and Dr. Aleksandra Zgierska are conducting a pilot study for research at The Pennsylvania State University, and are asking for your consent for you and your child to participate. The purpose is to help find out if the planned study activities are acceptable and can be completed by future participants. This pilot study will recruit between 10 and 31 pilot participants at each of 25 locations across the United States where the main study will also be done. This section provides a summary of important information. The rest of the form provides additional details. </p>"
    },
    {
     "type": "text",
     "name": "globalID",
     "visible": false,
     "width": "550px",
     "minWidth": "550px",
     "maxWidth": "550px",
     "title": "globalID",
     "surveyVariable": "ParticipantVariable:globalId"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "key_information",
   "elements": [
    {
     "type": "html",
     "name": "question65",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:center\"><u>\nKey Information</u></h4>\n<br />\n\n<p style=\"text-align:left;color:black;font-size:16px\"><b>The following is a short summary of this study to help you decide whether or not to be a part\nof this research. More detailed information is provided later in this form. If you have any\nquestions, be sure to ask the study team.</b></p>\n\n\n<p style=\"text-align:left;color:black;font-size:16px\"><b>Why am I being invited to take part in this research study?</b><br />\n\nWe are asking you to take part in this voluntary research study because you live in central\nPennsylvania and are pregnant, have just delivered a child, or have a child who is 9 months of age\nor younger.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\"><b>What is the purpose of this research study?</b><br />\n\nThe purpose of this voluntary pilot study is to inform a nation-wide research project that is\nintended to learn how children grow and change (develop) early in life. We will study children’s\nthinking, behavior, social interactions, emotions, and brains from birth through 10 years old. The\nresearch will look at many factors that might be helpful or harmful to a child’s development.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\"><b>How long will the research study last?</b><br />\n\nIf you agree for you and your child to participate, we will ask you to take part in completing one to\ntwo visits, either during your pregnancy, at less than 1 month of age for your child, or between 3-9\nmonths of age for your child. These visits will take place in-person, or some parts may be done\nremotely. The length of visits will vary and may last between approximately one to seven hours per\nvisit (which can be broken up into multiple visits).</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\"><b>What will I need to do?</b><br />\n\nThis study will include interviews, questionnaires and other tests about yourself and your child.\nThese specific activities will vary based on how far into your pregnancy you are or how old your child is. Please see below for specifics.</p>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "key_information_2",
   "elements": [
    {
     "type": "html",
     "name": "question67",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\"><b>What are the main risks of taking part in the study?</b><br />\n\nFor this study, the main risks to know about are those associated with completing the surveys,\nthe blood draw, or the MRI. For more detailed information on those risks, please see the section\nentitled, <b><i>“What risks are associated with this study?” below.</i></b></p>\n\n<p style=\"text-align:left;color:black;font-size:16px\"><b>What are the possible benefits to me that may reasonably be expected from being in the\nresearch?</b><br />\n\nThere are no benefits to you from taking part in this research. Results of the study may benefit\nother people in the future by helping us learn more about improving the lives of children and their\nfamilies. The overall goal of this study is to better understand how children grow up in different\nenvironments.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\"><b>What happens if I do not want to be in this research?</b><br />\n\nParticipation in research is completely voluntary. You can decide whether to participate or not to\nparticipate. You may choose not to take part in this research study.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\"><b>What will I have to pay for if I take part in this research study?</b><br />\n\nYou and/or your insurance company will not be charged for the cost of any tests or procedures that\nare required as part of the research and are outside the standard of care (what is normally done) for\nyour condition. Examples of research-related tests and procedures that may be provided at no cost\nto you may include: visits to the study site, procedures, research blood draws, and/or\nquestionnaires. Talk to the study team about which items and procedures this includes.</p>"
    },
    {
     "type": "html",
     "name": "question64",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<ul style=\"font-size:16px;color:black\">\n<li>Research is voluntary - whether or not you agree for you and or your child to participate in this research is your decision. You can discuss your decision with others (such as family, friends, or your or your child’s doctor).</li>\n\n<li>You can say yes but change your mind later.</li>\n\n<li>If you say no, we will not hold your decision against you or your child, and your decision will not affect your or your child’s health care or any other benefits you or your child may be entitled to.</li>\n\n<li>Please ask questions or mention concerns before, during or after the research</li>\n</ul>\n"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
