     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:center\"><u>\nAdditional Information</u></h4>\n\n<br /><h4 style=\"text-align:left\"><b><i>\nWhy you and your child have been asked to participate, how you and your child were selected, and what is the approximate number of participants in the study? </i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You and or your child have been asked to participate in this pilot study because you live in central PA, you are pregnant or you have a child 9 months of age or younger. There will be approximately 10-31 birth parents and their children participating across the University Park and College of\nMedicine sites. There will be approximately 250-450 birth parent-child pairs participating at all 25 sites across the United States. </p>\n\n<p style=\"text-align:left;color:black;font-size:16px\"><b>What is the purpose of this research study?</b><br />\n\nThe purpose of this voluntary pilot study is to inform a nation-wide research project that is\nintended to learn how children grow and change (develop) early in life. We will study children’s\nthinking, behavior, social interactions, emotions, and brains from birth through 10 years old. The\nresearch will look at many factors that might be helpful or harmful to a child’s development.\nThese include exposure to tobacco, alcohol, and other drugs before birth, family members’\nmental health and stress, the family’s social and economic environment, the child’s exposure to\ntoxins, and how the parent or caregiver interacts with their child. The overall goal of this study is\nto better understand how children grow up in different environments. While there is no direct\nbenefit to you from participating, the results of this study may help scientists design new\nmethods for improving the lives of children and their families.</p>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page3.1",
