    {
     "type": "html",
     "name": "question49",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<br /><h4 style=\"text-align:left\"><b><i>\nWhat will you need to do? What will happen to you or your child in this study? </i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">If you agree for you and or your child to participate, we will ask you to take part in completing\none to two visits, either during your pregnancy, at less than 1 month of age for your child, or\nbetween 3-9 months of age for your child. These visits will take place in-person, or some parts\nmay be done remotely. <i>The length of visits will vary</i> and may last between approximately one to\nseven hours per visit (which can be broken up into multiple visits). This will include completing\ninterviews, questionnaires, and other tests about yourself and or your child for the visits that are\nplanned for the first year of the study. We may ask you and or your child to wear small devices\nfor a few days to measure heart rate and or movement. We may ask you and or your child to\nprovide some biological samples. Because this study is looking at how a child’s brain develops\nin the first years of life, we may ask that you allow your child to have brain scans and other\nmeasures of how your child’s brain is developing.</p>"
    }
   ],
