     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\">The brain MRI visits visits will be done at the Social, Life, and Engineering Sciences Imaging Center\n(SLEIC), Chandlee Laboratory, Penn State University, University Park, PA 16802. Directions and free\nparking will be provided. Because MRI involves being placed in a strong magnetic field, it is not safe\nfor your child to be in or near an MRI scanner if they have metal on their body, such as pierced\nearrings. You will be asked to remove anything metallic from your child before the scan.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The EEGs will be done at our offices in the Moore Building, Penn State University, University\nPark, PA 16802.. Your child will wear a special head “net” or cap for a brief period of time while\ndoing the study tasks.</p>"
