    {
     "type": "html",
     "name": "question20",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:left\"><b><i>\nHow much time will each study visit take and how long will the study last? </i></b></h4>\n\n<ul style=\"font-size:16px;color:black\">\n<li>The pregnancy visit will take approximately 3 hours. The separate heart rate device setup visit during pregnancy will take approximately 20 minutes. Completing the questionnaires about yourself while wearing the device will take 10 minutes.</li>\n\n<li>The study visit for a child less than 1 month of age for all study measures except MRI or mock MRI and the infant heart rate device will take approximately 2 hours.</li>\n\n<li>The separate heart rate device setup visit for a child less than 1 month of age will take approximately 20 minutes. Completing the questionnaires about your child while wearing the device will take 10 minutes.</li>\n\n<li>The study visit for a child between 3 and 9 months of age for all measures except MRI, EEG and infant heart rate device will take approximately 2 hours.</li>\n\n<li>The separate heart rate device setup visit for a child 3-9 months of age will take approximately 20 minutes. Completing the questionnaires about your child while wearing the device will take 10 minutes.</li>\n\n<li>An MRI or mock MRI visit will take approximately 3 hours.</li>\n\n<li>The EEG or mock EEG visit will take approximately 2 hours.</li>\n\n<li>Completing the survey after your visits will take approximately 10 minutes.</li>\n</ul>\n\n"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page9",
   "elements": [
    {
     "type": "html",
     "name": "question21",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\"><b><i>What are the possible benefits to me that may reasonably be expected from being in the\nresearch?</i></b><br />\n\nYou or your child will not benefit directly if you and your child decide to take part in this pilot\nresearch study. The investigators, however, will learn about the acceptability and feasibility of the\nactivities proposed for the larger study. While not a direct benefit of the study, we will provide\ninformation to you about referrals and community support that you may wish to access for you or\nyour child.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">If you are incarcerated, participation in this study will not be a factor in parole board decisions.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\"><b><i>What happens if I do not want to be in this research?</i></b><br />\n\nParticipation in research is completely voluntary. You can decide whether to participate or not to\nparticipate. The alternative to participation in this pilot study is not to participate.</p>\n\n<h4 style=\"text-align:left\"><b><i>\nWhat happens if you change your mind about participating?</i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Participation in this pilot research is entirely voluntary. You may refuse to participate or withdraw at any time without penalty or loss of benefits to which you or your child are entitled. If you decide that you and your child no longer wish to continue in this pilot study, you may notify <br />\nDr. Pérez-Edgar in writing to 270 Moore Building, Penn State University, University Park, PA\n16802; by writing an email to hbcd@psu.edu; or calling Dr. Pérez-Edgar at (814) 865-9272.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You will be told if any important new information is found during the course of this pilot study that may affect your wanting to continue or allow your child to continue. </p>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page12",
   "elements": [
    {
     "type": "html",
     "name": "question39",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:left\"><b><i>\nCan you or your child be withdrawn from the study without your consent?</i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You and your child may be withdrawn from the pilot study if Dr. Pérez-Edgar or the HBCD investigators believe it is in your or your child’s best medical interest or if you do not follow the instructions from the study personnel.</p>\n\n\n\n<br /><h4 style=\"text-align:left\"><b><i>\nWill you be compensated for participating in this study?</i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You will be compensated for your and your child’s time participating in the study approximately according to the amount of time required to complete the visit measures and to provide the biological samples. The following compensation schedule applies to the specific activities listed for the pregnancy or infant pilot that you and your child are being asked to do.</p>\n\n\n<table style=\"color:black;font-size:16px\"> \n<tr>\n<td style=\"padding-left:20px;padding-right:20px\"><li>Pregnancy visit without heart rate device:</li></td>\n<td>$100\n</td></tr>\n\n<tr>\n<td style=\"padding-left:20px;padding-right:20px\"><li>Pregnancy heart rate device:</li></td>\n<td>$50\n</td></tr>\n\n<tr>\n<td style=\"padding-left:20px;padding-right:20px\"><li>&lt;1 month-old parent/infant visit without MRI or heart rate device:</li></td>\n<td>$25\n</td></tr>\n\n<tr>\n<td style=\"padding-left:20px;padding-right:20px\"><li>&lt;1 month-old infant MRI or mock MRI:</li></td>\n<td>$100\n</td></tr>\n\n<tr>\n<td style=\"padding-left:20px;padding-right:20px\"><li>&lt;1 month-old infant heart rate device:</li></td>\n<td>$50\n</td></tr>\n\n<tr>\n<td style=\"padding-left:20px;padding-right:20px\"><li>3-9 month-old parent/infant visit without MRI, EEG, or heart rate device:</li></td>\n<td>$50\n</td></tr>\n\n<tr>\n<td style=\"padding-left:20px;padding-right:20px\"><li>3-9 month-old infant MRI or mock MRI:</li></td>\n<td>$100\n</td></tr>\n\n<tr>\n<td style=\"padding-left:20px;padding-right:20px\"><li>3-9 month-old infant EEG or mock EEG:</li></td>\n<td>$75\n</td></tr>\n\n<tr>\n<td style=\"padding-left:20px;padding-right:20px\"><li>3-9 month-old infant heart rate device:</li></td>\n<td>$50\n</td></tr>\n</table>\n\n<br />\n<p style=\"text-align:left;color:black;font-size:16px\">The payment will be given as a gift card. We will also reimburse you for transportation if needed\nfor study visits, and will provide you with access to food, consider options for assistance with\nchildcare, and other small gifts such as diapers or a book or toy. If you move out of the study area\nfor a certain site, you will be given the option to transition to another study site closer to your new\nlocation.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">There may be tax reporting implications if the amount of compensation you receive in a year\nexceeds $600. Your social security number will be obtained in order to report compensation to\nthe IRS if the amount of compensation you receive in a year exceeds $600.</p>"
    }
   ],
