     "name": "question27",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:right;color:black;font-size:16px;margin:0\">UCSD Project 802055</p>\n<p style=\"text-align:right;color:black;font-size:16px;margin:0\">Adult Consent</p>\n\n<br /><h4 style=\"text-align:center\"><b>\nEXPERIMENTAL SUBJECT’S BILL OF RIGHTS</b></h4>\n\n<br /><p style=\"text-align:left;color:black;font-size:16px\">The faculty and staff of the Pennsylvania State University, University Park wish you to know: </p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Any person who is requested to consent to participate as a subject in a research study involving a medical experiment, or who is requested to consent on behalf of another, has the right to: </p>\n\n<ol style=\"font-size:16px;color:black\">\n<li>Be informed of the nature and purpose of the experiment.</li>\n\n<li>Be given an explanation of the procedures to be followed in the medical experiment, and any drug or device to be used.</li>\n\n<li>Be given a description of any attendant discomforts and risks reasonably to be expected from the experiment.</li>\n\n<li>Be given an explanation of any benefits to the subject reasonably to be expected from the experiment, if applicable.</li>\n\n<li>Be given a disclosure of any appropriate alternative procedures, drugs, or devices that might be advantageous to the subject, and their relative risks and benefits.</li>\n\n<li>Be informed of the avenues of medical treatment, if any, available to the subject after the experiment if complications should arise.</li>\n\n<li>Be given an opportunity to ask any questions concerning the experiment or the procedures involved.</li>\n\n<li>Be instructed that consent to participate in the medical experiment may be withdrawn at any time, and the subject may discontinue participation in the medical experiment without prejudice.</li>\n\n<li>Be given a copy of a signed and dated written consent form when one is required.</li>\n\n<li>Be given the opportunity to decide to consent or not to consent to a medical experiment without the intervention of any element of force, fraud, deceit, duress, coercion, or undue influence on the subject’s decision.</li>\n</ol>\n\n<p style=\"text-align:left;color:black;font-size:16px\">If you have questions regarding a research study, the researcher or his/her assistant will be glad\nto answer them. You may seek information from the Human Research Protections Program -\nestablished for the protection of volunteers in research projects - by calling 814-865-1775 from\n8:00 AM to 5:00 PM, Monday through Friday, or by emailing orp@psu.edu.</p>\n\n\n"
    }
