     "type": "html",
     "name": "question1",
     "html": "<h4 style=\"text-align:Right\">\nSTUDY0019548</h4>\n<h4 style=\"text-align:Right\">\nScreening Script</h4><br />\n<h3 style=\"text-align:center\"><p><b>\nThe Pennsylvania State University</b></p></h3>\n<h3 style=\"text-align:center\"><p><b>\nScreening Script with Consent</b></p></h3>\n<h4 style=\"text-align:center\"><p><b>\nThe HEALthy Brain and Child Development (HBCD) Study</b></p></h4>"
    },
    {
